content.css:
/* ===== Scrollbar CSS ===== */
/* Firefox */
* {
  scrollbar-width: auto;
  scrollbar-color: #79ACD2 #ffffff;
}
/* Chrome, Edge, and Safari */
*::-webkit-scrollbar {
  width: 16px;
}
*::-webkit-scrollbar-track {
  background: #ffffff;
}
*::-webkit-scrollbar-thumb {
  background-color: #79ACD2;
  border-radius: 10px;
  border: 4px solid #ffffff;
}
div {
  cursor: default;
}
div.ganttview-hzheader-mont div.ganttview-hzheader-week,
div.ganttview-vtheader,
div.ganttview-vtheader-item-name,
div.ganttview-vtheader-series,
div.ganttview-grid,
div.ganttview-grid-row-cell {
  float: left;
}
div.ganttview-hzheader-month {
  text-align: center;
}
div.ganttview-hzheader-week {
  text-align: left;
  padding-left: 5px;
}
div.ganttview-grid-row-cell.last,
div.ganttview-hzheader-week.last,
div.ganttview-hzheader-month.last {
  border-right: none;
}
/* Horizontal Header */
div.ganttview-hzheader-month {
  height: 20px;
  border-right: 1px solid #d0d0d0;
  line-height: 20px;
  display: inline-block;
  background-color: #575b61;
  color: white;
}
div.ganttview-hzheader-week {
  height: 20px;
  border-right: 1px solid #f0f0f0;
  border-top: 1px solid #d0d0d0;
  line-height: 20px;
  color: #777;
  display: inline-block;
  font-size: 10px;
  background-color: #79ACD2;
  color: white;
}
/* Controls */
div.GanttControl {
  padding-left: 240px;
}
div.GanttControl-inner {
  margin-bottom: 10px;
  text-align: center;
  position: relative;
}
div.GanttControl-Button {
  display: inline-block;
  width: 50px;
  margin-left: 100px;
  margin-right: 100px;
  height: 30px;
  font-size: 25px;
  font-weight: 900;
  color: #232323;
}
div.GanttControl-Button-clicked {
  color: red !important;
}
div.GanttControl-Button:hover {
  opacity: 0.5;
  cursor: pointer;
}
div.GanttControl-Button-home {
  position: absolute;
  width: 18px;
  height: 18px;
  background-image: url('data:image/png;base64,');
  background-repeat: no-repeat;
  background-size: contain;
  left: calc(50% - 9px);
  top: 10px;
  opacity: 0.8;
}
div.GanttControl-Button-home:hover {
  opacity: 0.4;
  cursor: pointer;
}
/* Vertical Header */
div.ganttview-vtheader {
  margin-top: 44px;
  width: 240px;
  overflow: hidden;
  background-color: #fff;
  font-size: 12px;
}
div.ganttview-vtheader-item {
  overflow: hidden;
  color: #666;
}
div.ganttview-vtheader-item-name {
  width: 100px;
  padding-left: 5px;
  border-top: 1px solid #d0d0d0;
  line-height: 16px;
  background-color: #79ACD2;
  color: white;
}
.ganttview-vtheader-series-name-Text-select {
  font-weight: bold;
}
div.ganttview-vtheader-series-name {
  width: 130px;
  height: 31px;
  line-height: 16px;
  padding-left: 5px;
  text-overflow: ellipsis;
  overflow: hidden;
  border-top: 1px solid #d0d0d0;
  position: relative;
  background-color: #EEE;
}
div.ganttview-vtheader-series-name .ganttview-vtheader-series-name-Text {
  display: inline-block;
  width: calc(100% - 16px);
  vertical-align: top;
  cursor: pointer;
}
div.ganttview-vtheader-series-name .ganttview-vtheader-series-name-Glyph {
  display: inline-block;
  vertical-align: top;
  background-color: #BBB;
  text-align: center;
  color: white;
  font-weight: 900;
  padding: 2px;
  height: 10px;
  width: 10px;
  line-height: 8px;
  border-radius: 10px;
  margin-right: 2px;
  margin-top: 2px;
  cursor: pointer;
}
div.ganttview-vtheader-series-name:hover {
  background-color: #DDD;
  cursor: pointer;
}
.ganttview-vtheader-series-name-select {
  background-color: #79ACD2 !important;
  color: white;
  opacity: 0.8;
}
/* Slider */
div.ganttview-slide-container {
  overflow: hidden;
  border-left: 1px solid #999;
  position: relative;
}
/* Grid */
div.gantview-grid-row-sep {
  border-top: 1px solid #CCC;
}
div.gantview-grid-row-no-sep {
  padding-top: 1px;
}
div.ganttview-grid-row-cell {
  height: 31px;
  display: inline-block;
  position: relative;
}
div.ganttview-grid-row-cell.ganttview-weekend {
  background-color: #EEEEEE;
}
div.todayBar {
  border-left: 4Px Solid rgba(255, 0, 0, 0.8);
  position: absolute;
  z-index: 10;
  width: 4px;
  left: 3px;
}
div.todayBar .todayBar-text {
  background: white;
  border: 2px solid red;
  position: absolute;
  font-size: 11px;
  color: red;
  padding: 2px;
  left: -41px;
  top: 2px;
  width: 80px;
  font-weight: bold;
  text-align: center;
  display: none;
}
div.todayBar:hover {
  border-left: 4Px dotted rgba(255, 0, 0, 0.5);
}
div.todayBar:hover .todayBar-text {
  display: block;
}
/* Blocks */
div.ganttview-blocks {
  margin-top: 40px;
}
div.ganttview-block-container {
  height: 28px;
  padding-top: 4px;
}
div.ganttview-block {
  position: relative;
  height: 25px;
  background-color: #E5ECF9;
  border: 1px solid #c0c0c0;
  border-radius: 3px;
  -moz-border-radius: 3px;
  -webkit-border-radius: 3px;
}
div.ganttview-block-text {
  position: absolute;
  height: 12px;
  font-size: 0.8em;
  color: #999;
  padding: 2px 3px;
}
/* tasks */
div.ganttview-task {
  position: absolute;
  height: 15px;
  background-color: #002957;
  display: inline-block;
  margin-top: 53px;
  opacity: 0.7;
  z-index: 300;
  color: white;
  font-size: 10px;
  padding: 2px;
  text-overflow: ellipsis;
  overflow: hidden;
  white-space: nowrap;
  vertical-align: middle;
}
div.ganttview-task:hover {
  opacity: 1;
  margin-top: 51px;
}
/* Milestones */
div.ganttview-milestone {
  position: absolute;
  height: 25px;
  width: 25px;
  background-repeat: no-repeat;
  background-size: contain;
  display: inline-block;
  margin-top: 49px;
  opacity: 0.7;
  z-index: 300;
}
.ganttview-milestone-todo {
  background-image: url('data:image/png;base64,');
}
.ganttview-milestone-late {
  background-image: url('data:image/png;base64,');
}
.ganttview-milestone-done {
  background-image: url('data:image/png;base64,');
}
div.ganttview-milestone:hover {
  opacity: 1;
  transform: translateY(-2px);
}
.ganttview-slideContainer {
  overflow-y: auto;
  max-height: 500px;
  position: relative;
  border: 1px solid #BBB;
}
.milestoneTooltip {
  position: absolute;
  z-index: 300;
  pointer-events: none;
  border: 1px solid #AAAAAA;
  padding: 3px;
  background-color: white;
  opacity: 0.75;
}
.milestoneTooltip h1 {
  font-size: 14px;
  margin-top: 2px;
}
.milestoneTooltip span {
  font-size: 10px;
}
